import { FaShareAlt } from "react-icons/fa"

const SocialLinks = () =>{
    return (
    <label  className="social">
        <span className="fas fa-share-alt"></span>
        <a href="https://github.com/Bourichi-Taha"><span className="fab fa-github"></span></a>
        <a href="bourichi.taha@gmail.com"><span className="fa fa-envelope"></span></a>
        <a href="https://github.com/Bourichi-Taha"><span className="fab fa-linkedin"></span></a>
    </label>
    )
}

export default SocialLinks
